import '../Assets/Styles/ProjectsComponentStyles.css'
import ProjectsCardComponent from "./ProjectsCardComponent";
import Back from '../Assets/Img/back.jpg'

function ProjectsComponent(){
    return(
        <main className="projects-container">
            <div className="btns-container">
                <button className="rama-btn">FrontEnd</button>
                <button className="rama-btn">BackEnd</button>
            </div>
            <section className="cards-container">
                <ProjectsCardComponent name="project 1" src={Back} href="#"></ProjectsCardComponent>
                <ProjectsCardComponent name="project 1" src={Back} href="#"></ProjectsCardComponent>
                <ProjectsCardComponent name="project 1" src={Back} href="#"></ProjectsCardComponent>
